import React from 'react'

function inputTodo() {
    return (
        <div className='container d-flex  flex-column  align-items-center'>
            <h1 className='text text-align-center'>PERN TODO</h1>
            <form className='d-flex '>
                <input className='form-control' placeholder='Write your Todo.'/>
                <button type="submit" class="btn btn-primary mt-4 text-align" style={{width:'120px' ,alignContent:'center'}}>Add</button>
            </form>
        </div>
    )
}

export default inputTodo
